import React from 'react';
import {Bar} from 'react-chartjs-2'

const BarChart = () => {
    return (  
        <div>

            <Bar
                data = {{
                    labels:[
                        'USA','UK','China','Singapore','Malaysia','Russia'
                    ],
                    datasets: [
                        {
                            label: "Followers' countries",
                            data: [120,190,30,500,20,300],
                            backgroundColor: [
                                'rgba(255, 99, 132, 0.2)',
                                'rgba(54, 162, 235, 0.2)',
                                'rgba(255, 206, 86, 0.2)',
                                'rgba(75, 192, 192, 0.2)',
                                'rgba(153, 102, 255, 0.2)',
                                'rgba(255, 159, 64, 0.2)'
                            ],
                            borderColor: [
                                'rgba(255, 99, 132, 1)',
                                'rgba(54, 162, 235, 1)',
                                'rgba(255, 206, 86, 1)',
                                'rgba(75, 192, 192, 1)',
                                'rgba(153, 102, 255, 1)',
                                'rgba(255, 159, 64, 1)'
                            ],
                            borderWidth: 1
                        },
                    ],

                }}
                minHeight = {100}
                minWidth = {100}
                height = {200}
                width = {200}


            />
        </div>

    );
}

export default BarChart;
